import { Link } from 'react-router-dom'


export default class Landing extends Component {
     render() {
          return (
               <>
                    <h3 id='landing-title'>Why buy when you can mend?</h3>
                    <div src='https://images.unsplash.com/photo-1466699441713-4cb2ef1125f1?ixlib=rb-1.2.1&auto=format&fit=crop&w=1190&q=80' id='landing-banner'>Header image</div>
                    <section className='article-section'>What do we offer?</section>
                    <div id='landing-sec2'>
                         <h2>Cleaning and Repairing Garments</h2>

                         <Link to='/guides'>All Guides</Link>
                    </div>
               </>)
     }
}
